import React, {Component} from 'react';
import styled from 'styled-components';


class MyPage extends Component {
    
    render(){
        return(
           <MyPageForm>
              <MyPageIntroduceForm>
                <MyPageMyImage>
                   <img height='10%' width='20%' alt='사진' src={process.env.PUBLIC_URL +'/img/MypageImage.jpg'}/>
                   </MyPageMyImage>
                <MyPageText>
                    <Name>이름</Name><Name> <Ksh>강석호</Ksh></Name>
                    <Age>생년월일</Age><Age><Ksh>1996.1.17<br></br>25살(만24살)</Ksh></Age>
                    </MyPageText> 
                
                      
                </MyPageIntroduceForm>
               
           </MyPageForm>
        )
    }
}

export default MyPage;

const MyPageForm = styled.div`
  text-align:center;
`

const MyPageMyImage = styled.div`
  
`

const MyPageIntroduceForm = styled.div `

`

const MyPageText = styled.div `
   
`

const Name =  styled.div`
  margin-top:15px;
`
const Ksh = styled.b `
  
`
const Age = styled.div`
  margin-top:20px;
`
